import axios from 'axios';

const API = {

    searchGoogle: function() {
        return axios.get('https://www.googleapis.com/books/v1/volumes?key=AIzaSyAIY4R3KJo33zPFCjFeSoMxrFgHZBHiuw4&q=gatsby');
    }

}

export default API;
